import './App.css';
import React, { useState} from 'react';
import AddBookForm from './AddBookForm';
import BookList from './BookList';

function App() {

  const [books] = useState([ 
    { id: 1, title: 'Book1' },
    { id: 2, title: 'ook2' },
    { id: 3, title: 'book3' }
  ]);

  return (
    <>
    <h1 id="title">Favorite Books</h1>
    <AddBookForm/>
    <BookList books={books}/>
    </>
  );
}

export default App;
